import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, useLocation } from 'react-router-dom';
import Register from './auth/Register';
import Login from './auth/Login';
import Adminlogin from './auth/Adminlogin';
import Adminregistration from './Components/Adminregistration';
import Superadmin from './auth/Superadmin';
import Dashboard from './Dashboard';
import Newgrievance from './Newgrievance';
import Admin from './Admin';
import Adminmaster from './Adminmaster';
import View from './View';
import Complaint from './Components/Complaint';
import Home from './Home';
import Dashboardsuperadmin from './Dashboardsuperadmin';
import Manageusers from './Manageusers';
import Footer from './Footer/Footer';
import Navbar from './Navbar/Navbar';
import Sidebar from './Sidebar/sidebar.jsx';

function App() {
  const[image, setImage] = useState(null);
  const [showSidebar, setShowSidebar] = useState(false);
  const location = useLocation();

  const handle = (name) => {
    setImage(name);
    console.log(name);
  }

  const toggleSidebar = () => {
    setShowSidebar(!showSidebar);
  };

  // Define an array of routes where you want to hide the Navbar and Footer
  const routesWithoutNavAndFooter = ['/register', '/login', '/superadminlogin', '/adminlogin'];

  return ( 
    <>  
    <div className="area">
      <ul className="circles">
        <li></li>
        <li></li>
        <li></li>
        <li></li>
        <li></li>
        <li></li>
        <li></li>
        <li></li>
        <li></li>
        <li></li>
      </ul>

      <div className="context">
        {/* Conditionally render the Navbar */}
        {!routesWithoutNavAndFooter.includes(location.pathname) && (
          <Router>
            <Navbar toggleSidebar={toggleSidebar}/>
            <Sidebar showSidebar={showSidebar} toggleSidebar={toggleSidebar}/>
          </Router>
        )}

        <Router>
          <Routes>
            <Route path='/' element={<Home/>}/>
            <Route path='/history' element={<Dashboard/>}/>
            <Route path='/new' element={<Newgrievance/>}/>
            <Route path='/complaint' element={<Complaint handle_view={handle}/>}/>
            <Route path='/create-admin' element={<Adminregistration/>} />
            <Route path='/superadmin' element={<Adminmaster handle_view={handle}/>}/>
            <Route path='/dashboards-a' element={<Dashboardsuperadmin/>}/>
            <Route path='/manage-users' element={<Manageusers/>}/>
            <Route path="/image" element={<View image={image}/>} />
          </Routes>
        </Router>

        <Router>
          <Routes>
            <Route path='/superadminlogin' element={<Superadmin/>}/>
            <Route path='/adminlogin' element={<Adminlogin/>}/>
            <Route path="/register" element={<Register/>}/>
            <Route path="/login" element={<Login/>}/>  
          </Routes>
        </Router>

        {/* Conditionally render the Footer */}
        {!routesWithoutNavAndFooter.includes(location.pathname) && <Footer/>}
      </div>
    </div>
    </>
  );
}

export default App;
